import React from "react";
import idIcon from "./assets/i-id.png";
import comercioIcon from "./assets/i-comercio.png";
import depIcon from "./assets/i-dep.png";
import eduIcon from "./assets/i-edu.png";
import guarIcon from "./assets/i-guar.png";
import infraIcon from "./assets/i-infrasocial.png";
import ppIcon from "./assets/i-pp.png";
import saludIcon from "./assets/i-salud.png";

function AGEBInfo({ ageb, neighborhood }) {
  if (!ageb || !neighborhood) {
    return <div>No neighborhood or AGEB information available.</div>;
  }

  return (
    <div className="ageb-container">
      <div className="ageb-info">
        <div className="name">
          <h4>{neighborhood.display_name}</h4>
          <p className="cvegeo">CVEGEO: {ageb.properties.CVEGEO}</p>
        </div>

        <p>
          <img className="icon" src={comercioIcon} alt="Comercio Icon" />{" "}
          {ageb.properties.comercios_count}
        </p>

        <p>
          <img className="icon" src={depIcon} alt="Deportivos Icon" />{" "}
          {ageb.properties.deportivos_count}
        </p>
        <p>
          <img className="icon" src={eduIcon} alt="Educación Icon" />{" "}
          {ageb.properties.educacion_count}
        </p>
        <p>
          <img className="icon" src={guarIcon} alt="Guarderías Icon" />{" "}
          {ageb.properties.guarderias}
        </p>
        <p>
          <img
            className="icon"
            src={infraIcon}
            alt="Infraestructura Social Icon"
          />{" "}
          {ageb.properties.infraestructura_count}
        </p>
        <p>
          <img className="icon" src={ppIcon} alt="Plazas Públicas Icon" />{" "}
          {ageb.properties.pp_count}
        </p>
        <p>
          <img className="icon" src={saludIcon} alt="Salud Icon" />{" "}
          {ageb.properties.salud_count}
        </p>
      </div>

      <div className="model-info name">
        <h4>Prediction model goes here...</h4>
      </div>
    </div>
  );
}

export default AGEBInfo;
